def to_str(bytes):
    text, encoding = ftfy.guess_bytes(bytes)
    return text


class Dir:
    def __init__(self, name, length, files):
        self.name = name
        self.length = length
        self.files = files

    def json(self):
        if len(self.files) > 0:
            return {'name': self.name, 'length': self.length, 'files': [f.json() for f in self.files]}
        else:
            return {'name': self.name, 'length': self.length}

    def traversal(self):
        yield self
        for sub in self.files:
            yield from sub.traversal()

    def sort(self):
        self.files = sorted(self.files, key=lambda f: f.length, reverse=True)
        for f in self.files:
            f.sort()


def build_dir_tree(metainfo):
    root = Dir(metainfo['name'], 0, [])
    for path in sorted(metainfo.get('files', []), key=lambda f: f['path']):
        path, length = path['path'], path['length']
        if path.startswith('_____padding') or path.startswith('論壇文宣'):
            continue

        curr = root
        curr.length += length

        for dir in path.split('/'):
            if len(curr.files) > 0 and dir == curr.files[-1].name:
                curr = curr.files[-1]
                curr.length += length
            else:
                curr.files.append(Dir(dir, length, []))
                curr = curr.files[-1]

    root.sort()
    root.length = metainfo['length']
    return root.files[0] if len(root.files) == 1 and root.name == root.files[0].name else root


def metainfo2json(metadata: bytes):

    def to_json(metainfo):
        result = {}
        result['name'] = to_str(metainfo[b'name'])
        if b'files' in metainfo:
            files = []
            length = 0
            for file in metainfo[b'files']:
                if b'path.utf-8' in file:
                    path = '/'.join(str(sub) if isinstance(sub, int) else sub.decode(encoding='utf-8')
                                    for sub in file[b'path.utf-8'])
                else:
                    path = '/'.join(str(sub) if isinstance(sub, int) else to_str(sub)
                                    for sub in file[b'path'])

                files.append({'path': path, 'length': file[b'length']})

                length += file[b'length']

            result['files'] = files
            result['length'] = length
        else:
            result['length'] = metainfo[b'length']

        if b'publisher.utf-8' in metainfo:
            result['publisher'] = metainfo[b'publisher.utf-8'].decode()
        elif b'publisher' in metainfo:
            result['publisher'] = to_str(metainfo[b'publisher'])

        if b'publisher-url.utf-8' in metainfo:
            result['publisher-url'] = metainfo[b'publisher-url.utf-8'].decode()
        elif b'publisher-url' in metainfo:
            result['publisher-url'] = to_str(metainfo[b'publisher-url'])

        return result

    if metadata:
        try:
            metainfo = bdecode(metadata)
            return to_json(metainfo[b'info']) if b'info' in metainfo else to_json(metainfo)
        except Exception as e:
            logging.warning(e)
            logging.warning(metadata)
            return None
    else:
        return None


